	function queryString(params, _start) {
		return _.reduce(params, function(memo, value, key) {
			if (memo !== '')
				return memo + '&' + key + '=' + value;
			else
				return '?' + key + '=' + value;
		}, _start || '');
	}
	;

	function runMethod(_method, _params, _callback) {
		if (token) {
			_params.token = token;
		}
		var url = queryString(_params,
				'https://api.quantified-people.com/api.php?fct=' + _method);

		var xhr = Titanium.Network.createHTTPClient({
			onload : _callback
		});
		info(url);
		xhr.open('GET', url);
		xhr.send();
	}

